import React from 'react';

function HeroSupport() {
    return ( 
        <div className='container-fluid' id='supportHero'>
            <div className='p-5 mt-5' id='supportWrapper'>
                <h4>Support Portol</h4>
                <a href='#' style={{textDecoration: "none", color:"white"}}>Track Tickets</a>
            </div>
            <div className='row p-5 mb-5'>
                <div className='col-6'>
                    <h2>Search for an answer or browse help topics to create a ticket</h2>
                    <input placeholder='Eg: how do I activate F&O, why is my order getting rejected ...'></input>
                </div>
                <div className='col-6'>
                    <h2>Featured</h2>
                </div>
            </div>
        </div>
     );
}

export default HeroSupport;
